import ApolloClient from 'apollo-boost';
import { gql } from "apollo-boost";

const client = new ApolloClient({
  uri: 'https://api.spacex.land/graphql/',
});

client
  .query({
    query: gql`
      {
        rocket(country: "USA") {
          country
        }
      }
    `
  })
  .then(result => console.log(result));
